import React from 'react';

const CharacterCard = (props) => {
  return (
    <div id="character-card">
      {props.student.name}
      <button onClick={props.handleToggle} >Toggle</button>
      <button>Edit</button>
    </div>
  )
}

export default CharacterCard;
